import React from 'react'
import Navbar from './Navbar';

import Page_heading from './Contact/Page_heading';
import Contact_us from './Contact/Contact_us';


function Contact() {
  return (
    <div>
        <Navbar/>
        <Page_heading/>
        <Contact_us/>
        <Map/>
        <Footer/>

    </div>
  )
}

export default Contact;
